export default function GalleryContent() {
  function one() {
    document.getElementById('5').style.opacity = "0%";
    document.getElementById('1').style.opacity = "100%";
  }
  function two() {
    document.getElementById('1').style.opacity = "0%";
    document.getElementById('2').style.opacity = "100%";
  }
  function three() {
    document.getElementById('5').style.opacity = "0%";
    document.getElementById('1').style.opacity = "100%";
  }
  function four() {
    document.getElementById('5').style.opacity = "0%";
    document.getElementById('1').style.opacity = "100%";
  }
  function five() {
    document.getElementById('5').style.opacity = "0%";
    document.getElementById('1').style.opacity = "100%";
  }
  return (
    <div className="container">
      <img id="1" src="images/food.png"/>
      <img id="2" src="images/food.png"/>
      <img id="3" src="images/food.png"/>
      <img id="4" src="images/food.png"/>
      <img id="5" src="images/food.png"/>
      <style jsx>{`
      img {
      opacity: 0%;
      }
      `}</style>
    </div>
  )
}
